// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

import "./ABDKMath64x64.sol";
import "./INFT_FACTORY.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

interface IVAULT {

}

contract RUSD is ERC20, Ownable{
  INFT_FACTORY nft;
  IVAULT vault;
  uint minimumInvesting;
  uint constant dailyFactorToDivide = 30;

  struct CUSTUMER {
    uint intitialDate;
    uint endDate;
    bool isWithdrawal;
  }

  mapping (address => CUSTUMER) custumers;

  event NEWDEPOSIT(address indexed recipient, uint amount);

  constructor(address _nft, address _vault, uint _minimumInvesting) ERC20("RESERVA USD", "RUSD"){
    nft = INFT_FACTORY(_nft);
    vault = IVAULT(_vault);
    minimumInvesting =  _minimumInvesting;

  }

  function deposit(address _recipient, uint _amount) external onlyOwner returns(bool) {
    require(_amount == minimumInvesting, "Pool: The minimum of investing exceed the amount");
    _mint(_recipient, _amount);
    custumers[_recipient].intitialDate = block.timestamp;
    custumers[_recipient].endDate = 0;
    emit NEWDEPOSIT(_recipient, _amount);
    return true;
  }

  function addRewardOf(address _investor) external onlyOwner returns(bool) { 
    int128 interestDaily= calculateInterestDaily(nft.interestMonthly());
    int128 currentBalance = ABDKMath64x64.fromUInt(balanceOf(_investor));
    uint reward = ABDKMath64x64.toUInt(ABDKMath64x64.mul(currentBalance, interestDaily));
    _mint(_investor, reward);
    return true;
  }

  function stakeOf(address _investor) view external returns(uint){
    int128 balanceOfInvestor = ABDKMath64x64.fromUInt(balanceOf(_investor));
    int128 totalSupply = ABDKMath64x64.fromUInt(totalSupply());
    return ABDKMath64x64.toUInt(ABDKMath64x64.div(balanceOfInvestor, totalSupply));
  }

    //call it every day for all live. Nominal value as a ratio. 
  function calculateInterestDaily(int128 _interestMonthly) pure private returns(int128) {
    return ABDKMath64x64.div(_interestMonthly, ABDKMath64x64.fromUInt(dailyFactorToDivide));
  }

   function _calculateStakingRange(uint _endDate, uint _startDate, uint ref) pure private returns (uint stakePeriod) {
        uint stampTime = (_endDate - _startDate) / 1 days;
        require(stampTime >= ref, "Pool: You have to need complete at least one stake period.");
        uint r = stampTime % ref;
        if (r != 0) {
            stakePeriod = stampTime + (ref - r);
        }
        else {
            stakePeriod = stampTime;
        }   
        return stakePeriod;
    }

}
